const test=(admin)=>(
    <html>
        <h2>
            <p>host:{admin.host}</p>
            <p>Username:</p>
            <p>Password:</p>
        </h2>
    </html>
)

export function getProps(){
    return{
        admin:{
            host:"adminka",
            username:"wolker",
            password:"*****"
        }
    }
}
export default test
